// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract BookingSite {
    // Enums
    enum BookingType { Bus, Cinema, Airline, Railway, Cricket }

    // Structs
    struct UserStruct {
        uint256 userID;
        string name;
        uint8 age;
        string contactDetails;
    }

    struct BusBookingStruct {
        string busNumber;
        string origin;
        string destination;
        uint256 dateOfJourney;
        uint8 seatNumber;
    }

    struct CinemaBookingStruct {
        string movieName;
        string cinemaHall;
        uint256 showTime;
        uint8 seatNumber;
    }

    struct AirlineBookingStruct {
        string flightNumber;
        string origin;
        string destination;
        uint256 dateOfJourney;
        string seatClass; // e.g., Economy, Business
    }

    struct RailwayBookingStruct {
        string trainNumber;
        string origin;
        string destination;
        uint256 dateOfJourney;
        uint8 seatNumber;
    }

    struct CricketBookingStruct {
        string matchDetails;
        string stadium;
        uint256 matchDate;
        uint8 seatNumber;
    }

    struct BookingStruct {
        uint256 bookingID;
        BookingType bookingType;
        UserStruct user;
        BusBookingStruct busBooking;
        CinemaBookingStruct cinemaBooking;
        AirlineBookingStruct airlineBooking;
        RailwayBookingStruct railwayBooking;
        CricketBookingStruct cricketBooking;
    }

    // State Variables
    uint256 private bookingCounter; // Counter for generating booking IDs
    mapping(uint256 => BookingStruct) public bookings; // Mapping of bookingID to BookingStruct

    // Functions

    // 1. bookBusTicket Function
    function bookBusTicket(
        string memory name,
        uint8 age,
        string memory contactDetails,
        string memory busNumber,
        string memory origin,
        string memory destination,
        uint256 dateOfJourney,
        uint8 seatNumber
    ) public {
        bookingCounter++; // Increment booking counter

        // Create UserStruct
        UserStruct memory user = UserStruct(bookingCounter, name, age, contactDetails);

        // Create BusBookingStruct
        BusBookingStruct memory busBooking = BusBookingStruct(busNumber, origin, destination, dateOfJourney, seatNumber);

        // Create BookingStruct
        BookingStruct memory newBooking = BookingStruct(
            bookingCounter,
            BookingType.Bus,
            user,
            busBooking,
            CinemaBookingStruct("", "", 0, 0), // Empty CinemaBookingStruct
            AirlineBookingStruct("", "", "", 0, ""), // Empty AirlineBookingStruct
            RailwayBookingStruct("", "", "", 0, 0), // Empty RailwayBookingStruct
            CricketBookingStruct("", "", 0, 0) // Empty CricketBookingStruct
        );

        // Store the booking
        bookings[bookingCounter] = newBooking;
    }

    // 2. bookCinemaTicket Function
    function bookCinemaTicket(
        string memory name,
        uint8 age,
        string memory contactDetails,
        string memory movieName,
        string memory cinemaHall,
        uint256 showTime,
        uint8 seatNumber
    ) public {
        bookingCounter++; // Increment booking counter

        // Create UserStruct
        UserStruct memory user = UserStruct(bookingCounter, name, age, contactDetails);

        // Create CinemaBookingStruct
        CinemaBookingStruct memory cinemaBooking = CinemaBookingStruct(movieName, cinemaHall, showTime, seatNumber);

        // Create BookingStruct
        BookingStruct memory newBooking = BookingStruct(
            bookingCounter,
            BookingType.Cinema,
            user,
            BusBookingStruct("", "", "", 0, 0), // Empty BusBookingStruct
            cinemaBooking,
            AirlineBookingStruct("", "", "", 0, ""), // Empty AirlineBookingStruct
            RailwayBookingStruct("", "", "", 0, 0), // Empty RailwayBookingStruct
            CricketBookingStruct("", "", 0, 0) // Empty CricketBookingStruct
        );

        // Store the booking
        bookings[bookingCounter] = newBooking;
    }

    // 3. bookAirlineTicket Function
    function bookAirlineTicket(
        string memory name,
        uint8 age,
        string memory contactDetails,
        string memory flightNumber,
        string memory origin,
        string memory destination,
        uint256 dateOfJourney,
        string memory seatClass
    ) public {
        bookingCounter++; // Increment booking counter

        // Create UserStruct
        UserStruct memory user = UserStruct(bookingCounter, name, age, contactDetails);

        // Create AirlineBookingStruct
        AirlineBookingStruct memory airlineBooking = AirlineBookingStruct(flightNumber, origin, destination, dateOfJourney, seatClass);

        // Create BookingStruct
        BookingStruct memory newBooking = BookingStruct(
            bookingCounter,
            BookingType.Airline,
            user,
            BusBookingStruct("", "", "", 0, 0), // Empty BusBookingStruct
            CinemaBookingStruct("", "", 0, 0), // Empty CinemaBookingStruct
            airlineBooking,
            RailwayBookingStruct("", "", "", 0, 0), // Empty RailwayBookingStruct
            CricketBookingStruct("", "", 0, 0) // Empty CricketBookingStruct
        );

        // Store the booking
        bookings[bookingCounter] = newBooking;
    }

    // 4. bookRailwayTicket Function
    function bookRailwayTicket(
        string memory name,
        uint8 age,
        string memory contactDetails,
        string memory trainNumber,
        string memory origin,
        string memory destination,
        uint256 dateOfJourney,
        uint8 seatNumber
    ) public {
        bookingCounter++; // Increment booking counter

        // Create UserStruct
        UserStruct memory user = UserStruct(bookingCounter, name, age, contactDetails);

        // Create RailwayBookingStruct
        RailwayBookingStruct memory railwayBooking = RailwayBookingStruct(trainNumber, origin, destination, dateOfJourney, seatNumber);

        // Create BookingStruct
        BookingStruct memory newBooking = BookingStruct(
            bookingCounter,
            BookingType.Railway,
            user,
            BusBookingStruct("", "", "", 0, 0), // Empty BusBookingStruct
            CinemaBookingStruct("", "", 0, 0), // Empty CinemaBookingStruct
            AirlineBookingStruct("", "", "", 0, ""), // Empty AirlineBookingStruct
            railwayBooking,
            CricketBookingStruct("", "", 0, 0) // Empty CricketBookingStruct
        );

        // Store the booking
        bookings[bookingCounter] = newBooking;
    }

    // 5. bookCricketTicket Function
    function bookCricketTicket(
        string memory name,
        uint8 age,
        string memory contactDetails,
        string memory matchDetails,
        string memory stadium,
        uint256 matchDate,
        uint8 seatNumber
    ) public {
        bookingCounter++; // Increment booking counter

        // Create UserStruct
        UserStruct memory user = UserStruct(bookingCounter, name, age, contactDetails);

        // Create CricketBookingStruct
        CricketBookingStruct memory cricketBooking = CricketBookingStruct(matchDetails, stadium, matchDate, seatNumber);

        // Create BookingStruct
        BookingStruct memory newBooking = BookingStruct(
            bookingCounter,
            BookingType.Cricket,
            user,
            BusBookingStruct("", "", "", 0, 0), // Empty BusBookingStruct
            CinemaBookingStruct("", "", 0, 0), // Empty CinemaBookingStruct
            AirlineBookingStruct("", "", "", 0, ""), // Empty AirlineBookingStruct
            RailwayBookingStruct("", "", "", 0, 0), // Empty RailwayBookingStruct
            cricketBooking
        );

        // Store the booking
        bookings[bookingCounter] = newBooking;
    }

    // 6. getBooking Function
    function getBooking(uint256 _bookingID) public view returns (BookingStruct memory) {
        return bookings[_bookingID];
    }

    // 7. getTotalBookings Function
    function getTotalBookings() public view returns (uint256) {
        return bookingCounter;
    }
}

